# Setting Up a basic chatbot

## Step - 1

Go to the chatbot post request and experiment with the chatbot. All the Chat History wil be stored in the Chat History variable.

# Step - 2

Write a post request in this format

``` json
{
      "contents": [
        {"role":"user",
         "parts":[{
           "text": "Hello chatbot , nice to meet you !"}]}
      ]
}

 ```

# Step - 3

send the post request and see the response , interact with the chatbot

